import Portal from '../../utils/CreatePortal';
import * as CLOSE_ICON from '../../static/close-icon.svg';
import './styles/imagePopup.scss';
const ImagePopup = ({ 1: imagesrc }) => {
  return (
    <Portal className="image-popup__portal">
      <div className="image-popup__bg">
        <figure className="image-popup__img-container">
          <button className="image-popup__close">
            CLOSE
            <img src={CLOSE_ICON} alt="" className="image-popup__close-icon" />
          </button>
          <img src={imagesrc} alt="" className="image-popup__img" />
        </figure>
      </div>
    </Portal>
  );
};

export default ImagePopup;
